import {PesonList,PersonDetails} from '../SwComponents';
import Row from '../Row';


export default class PeoplePage extends React.Component{
state={
    selectedItem:null
}
onitemSelected(selectedItem){
this.setState({selectedItem})
}

    render(){
        return(
<Row left={<PesonList onItemSelected={this.onitemSelected}/>} right={<PersonDetails itemId={this.state.selectedItem}/>}/>
        )
    }
}
